(28, 'Postingan Dummy ', 5, 16, '<p><span style=\"text-align: justify;\">Menjelang Serah terima jabatan (Sertijab) Komandan Kodiklatal (Dankodiklatal), Letjen TNI Marinir Suhartono memimpin apel khusus yang diikuti para Perwira, Bintara, Tamtama, Pegawai Negeri Sipil (PNS), serta Jalasenastri, dan para Siswa yang saat ini mengikuti pendidikan di Kodiklatal, bertempat di Lapangan Laut Maluku Kodiklatal, Bumimoro Surabaya. Senin, (23/10/2023).</span></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"d7c2922ee5c957bf0e0a28508ae46369.jpg\" style=\"width: 440.299px; height: 293.532px; float: left;\"></p><p style=\"text-align: justify; \">&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"text-align: justify;\">Dalam amanatnya, Dankodiklatal menyampaikan bahwa apel khusus ini sekaligus exit briefing terakhir dihadapan para personel di Kodiklatal. Seperti yang diketahui bahwa pada tanggal 27 September lalu, Letjen TNI Marinir Suhartono mendapatkan Kep Panglima TNI untuk menempati jabatan baru sebagai Irjen TNI.</span><br></p><p><br></p>', '2023-10-25 07:09:00', '2025-03-24 07:43:42', 0, 'Postingan-Dummy-', '90a1e831286ead54166a87d1e9d3c1df.jpg', 8, 'pusdiklekadmin', 'pusdiklekadmin');
