(38, ' SATGAS TRISILA GELAR BAKTI SOSIAL', 3, 12, '<p><span style=\"text-align: justify;\">Dalam rangka mendukung kegiatan Satgas Operasi Trisila-25, TNI Angkatan Laut menggelar bakti sosial dengan membagikan sebanyak 450 paket takjil kepada masyarakat di depan Kantor Pomal Lanal Lampung, Jl. Yos Sudarso KM. 10, Panjang, Bandar Lampung. Sabtu (22/03/2025).</span><br style=\"border-collapse: collapse; text-align: justify;\"><br style=\"border-collapse: collapse; text-align: justify;\"><span style=\"text-align: justify;\">Kegiatan ini diikuti oleh Letda Laut (P) M. Tri Wibowo, perwakilan anggota KRI BON-907, KRI TCN-543, Pasrat Marinir, perwira staf Lanal Lampung, serta para pembina dan anggota Saka Bahari Panjang. Pembagian takjil ini merupakan bentuk kepedulian sosial TNI AL kepada masyarakat, khususnya dalam bulan suci Ramadan.&nbsp;</span></p>', '2025-03-24 07:44:58', '2025-03-26 06:48:44', 1, '-SATGAS-TRISILA-GELAR-BAKTI-SOSIAL', '83b5009e040969ee7b60362ad7426573jpeg', NULL, 'admin', 'admin'),
(39, ' PANGKOARMADA III TERIMA KUNJUNGAN KEHORMATAN EGM PERTAMINA PATRA NIAGA REGIONAL PAPUA MALUKU', 3, 12, '<p><span style=\"text-align: justify;\">Panglima Komando Armada III (Pangkoarmada III) Laksamana Muda TNI Hersan, S.H., M.Si., menerima kunjungan kehormatan dari Executive General Manager (EGM) Pertamina Patra Niaga Regional Papua Maluku, Isfahani, beserta rombongan di Pacific Room, Markas Komando Armada III, Senin (24/3).</span><br style=\"border-collapse: collapse; text-align: justify;\"><br style=\"border-collapse: collapse; text-align: justify;\"><span style=\"text-align: justify;\">Kunjungan ini bertujuan memperkuat sinergitas antara Pertamina Patra Niaga Regional Papua Maluku dan Koarmada III khususnya dalam memastikan keamanan penyaluran Bahan Bakar Minyak (BBM) serta Liquefied Petroleum Gas (LPG) di wilayah Papua dan Maluku.</span><br style=\"border-collapse: collapse; text-align: justify;\"><br style=\"border-collapse: collapse; text-align: justify;\"><span style=\"text-align: justify;\">Dalam pertemuan tersebut, EGM Pertamina Patra Niaga menyampaikan apresiasi atas kesediaan Pangkoarmada III menerima kunjungan kerja ini. Ia menegaskan bahwa pertemuan ini merupakan langkah strategis untuk menjaga hubungan baik dengan berbagai pemangku kepentingan, mulai dari TNI-Polri hingga pemerintah daerah dan masyarakat.</span><br style=\"border-collapse: collapse; text-align: justify;\"><br style=\"border-collapse: collapse; text-align: justify;\"><span style=\"text-align: justify;\">Pangkoarmada III menyambut baik kunjungan tersebut dan menegaskan komitmen TNI AL dalam mendukung kelancaran distribusi energi sesuai dengan kewenangan yang dimiliki. Kedua pihak juga membahas sejumlah isu strategis, termasuk tantangan distribusi energi di wilayah perairan Papua dan Maluku, serta peran Pertamina Patra Niaga dalam mendukung ketahanan energi nasional dan program Asta Cita Pemerintah Pusat.</span><br style=\"border-collapse: collapse; text-align: justify;\"><br style=\"border-collapse: collapse; text-align: justify;\"><span style=\"text-align: justify;\">Turut hadir dalam pertemuan ini, Kas Koarmada III Laksamana Pertama TNI Singgih Sugiarto, S.T., M.Si., Kapok Sahli Koarmada III Laksamana Pertama TNI Heriyanto, serta para asisten Pangkoarmada III. Sementara itu, EGM Pertamina didampingi oleh Region Manager Retail Sales Papua Maluku Ayub Ritto, Region Manager HSSE Papua Maluku, serta sejumlah manajer dari tim sales dan CSR Pertamina Patra Niaga Regional Papua Maluku.</span><br style=\"border-collapse: collapse; text-align: justify;\"><br style=\"border-collapse: collapse; text-align: justify;\"><span style=\"text-align: justify;\">Dengan adanya kerja sama ini, diharapkan distribusi BBM dan LPG di Papua serta Maluku semakin terjamin, memberikan manfaat bagi masyarakat dan sektor industri di kedua wilayah tersebut.</span></p>', '2025-03-24 07:46:06', NULL, 1, '-PANGKOARMADA-III-TERIMA-KUNJUNGAN-KEHORMATAN-EGM-PERTAMINA-PATRA-NIAGA-REGIONAL-PAPUA-MALUKU', 'ea571676ce9b75b0730a5d56350ae93ejpeg', NULL, 'admin', NULL),
(40, ' KOMANDAN LANAL TUAL IKUTI TOURING DAN BUKA PUASA BERSAMA FORKOPIMDA MALUKU TENGGARA', 3, 12, '<p><span style=\"text-align: justify;\">Komandan Pangkalan TNI AL (Lanal) Tual, Kolonel Laut (P) Hananto Dwi P., ST., M.Tr.Hanla., M.M., turut serta dalam kegiatan touring dan buka puasa bersama yang diselenggarakan oleh Forum Koordinasi Pimpinan Daerah (Forkopimda) Kabupaten Maluku Tenggara bersama jajaran TNI pada Sabtu (22/03/2025).</span><br style=\"border-collapse: collapse; text-align: justify;\"><br style=\"border-collapse: collapse; text-align: justify;\"><span style=\"text-align: justify;\">Kegiatan ini diawali dengan pelepasan resmi peserta touring di Kantor Bupati Maluku Tenggara. Rombongan kemudian melintasi sejumlah desa, di antaranya Desa Badar, Matwad, Wirin, Ngursit, Tetoat, Dian Pulau, hingga Letvuan. Selain menjadi ajang silaturahmi di bulan suci Ramadan, kegiatan ini juga bertujuan memperkuat sinergi antara pemerintah daerah, TNI, dan masyarakat.</span><br style=\"border-collapse: collapse; text-align: justify;\"><br style=\"border-collapse: collapse; text-align: justify;\"><span style=\"text-align: justify;\">Tak hanya touring, kegiatan ini juga memiliki misi sosial. Sebanyak 1.167 paket sembako dibagikan kepada keluarga yang membutuhkan sebagai bentuk kepedulian terhadap masyarakat setempat.</span><br style=\"border-collapse: collapse; text-align: justify;\"><br style=\"border-collapse: collapse; text-align: justify;\"><span style=\"text-align: justify;\">“Kegiatan ini bukan hanya sekadar touring, tetapi juga wujud nyata kebersamaan dan kepedulian kami terhadap masyarakat. Melalui sinergi yang kuat, kita dapat terus menjaga kebersamaan dan kesejahteraan di wilayah Maluku Tenggara,” ujar Kolonel Laut (P) Hananto Dwi P.</span><br style=\"border-collapse: collapse; text-align: justify;\"><br style=\"border-collapse: collapse; text-align: justify;\"><span style=\"text-align: justify;\">Touring dan buka puasa bersama ini mendapat sambutan hangat dari masyarakat di sepanjang rute perjalanan. Banyak warga yang antusias menyambut rombongan, menunjukkan betapa eratnya hubungan antara aparat dan masyarakat di wilayah tersebut.</span><br style=\"border-collapse: collapse; text-align: justify;\"><br style=\"border-collapse: collapse; text-align: justify;\"><span style=\"text-align: justify;\">Dengan adanya kegiatan semacam ini, diharapkan semangat kebersamaan dan gotong royong terus terjalin, tidak hanya selama bulan Ramadan, tetapi juga dalam kehidupan sehari-hari di Maluku Tenggara.</span></p>', '2025-03-24 07:47:07', NULL, 1, '-KOMANDAN-LANAL-TUAL-IKUTI-TOURING-DAN-BUKA-PUASA-BERSAMA-FORKOPIMDA-MALUKU-TENGGARA', '182845aceb39c9e413e28fd549058cf8jpeg', NULL, 'admin', NULL),
(41, ' DANLANTAMAL VI HADIRI IMI AWARDS PROVINSI SULAWESI SELATAN', 3, 12, '<p><span style=\"text-align: justify;\">Komandan Lantamal VI (Danlantamal VI) Makassar Brigadir Jenderal TNI (Mar) Dr.Wahyudi, S.E., M.Tr.Hanla., M.M., M. Han menghadiri IMI Awards 2023-2024 Provinsi Sulawesi Selatan bertempat di Qanita Ballroom, Kirana Building Makassar, Sabtu (22/03/2025).</span><br style=\"border-collapse: collapse; text-align: justify;\"><br style=\"border-collapse: collapse; text-align: justify;\"><span style=\"text-align: justify;\">Kegiatan ini bertujuan untuk mengevaluasi program-program yang telah dilaksanakan oleh Ikatan Motor Indonesia (IMI) Sulsel sepanjang tahun 2023/2024 serta merencanakan langkah-langkah strategis untuk tahun 2025.</span><br style=\"border-collapse: collapse; text-align: justify;\"><br style=\"border-collapse: collapse; text-align: justify;\"><span style=\"text-align: justify;\">Sementara itu, IMI Awards 2023-2024 akan menjadi ajang penghargaan untuk memberikan apresiasi kepada individu maupun komunitas otomotif yang telah memberikan kontribusi luar biasa terhadap perkembangan otomotif di Sulawesi Selatan.</span><br style=\"border-collapse: collapse; text-align: justify;\"><br style=\"border-collapse: collapse; text-align: justify;\"><span style=\"text-align: justify;\">Danlantamal VI menyampaikan “Semoga IMI Sulsel kedepannya semakin berkembang jaya dan sukses sehingga melalui event apresiasi ini dapat memotivasi masyarakat untuk bisa mengembangkan potensi di bidang otomotif Provinsi Sulsel khususnya kota Makassar”.</span><br style=\"border-collapse: collapse; text-align: justify;\"><br style=\"border-collapse: collapse; text-align: justify;\"><span style=\"text-align: justify;\">Turut hadir dalam kegiatan tersebut Danpom XIV/Hsn, Dirlantas Polda Sulsel, Kadispora Sulsel, Pengurus IMI, Komunitas Otomotif, Serta para undangan lainya.</span></p>', '2025-03-24 07:47:57', NULL, 1, '-DANLANTAMAL-VI-HADIRI-IMI-AWARDS-PROVINSI-SULAWESI-SELATAN', 'd0096ec6c83575373e3a21d129ff8fef.jpg', NULL, 'admin', NULL),
(42, ' PANGKOARMADA III TERIMA KUNJUNGAN KEHORMATAN EGM PERTAMINA PATRA NIAGA REGIONAL PAPUA MALUKU', 3, 12, '<p><span style=\"text-align: justify;\">Panglima Komando Armada III (Pangkoarmada III) Laksamana Muda TNI Hersan, S.H., M.Si., menerima kunjungan kehormatan dari Executive General Manager (EGM) Pertamina Patra Niaga Regional Papua Maluku, Isfahani, beserta rombongan di Pacific Room, Markas Komando Armada III, Senin (24/3).</span><br style=\"border-collapse: collapse; text-align: justify;\"><br style=\"border-collapse: collapse; text-align: justify;\"><span style=\"text-align: justify;\">Kunjungan ini bertujuan memperkuat sinergitas antara Pertamina Patra Niaga Regional Papua Maluku dan Koarmada III khususnya dalam memastikan keamanan penyaluran Bahan Bakar Minyak (BBM) serta Liquefied Petroleum Gas (LPG) di wilayah Papua dan Maluku.</span><br style=\"border-collapse: collapse; text-align: justify;\"><br style=\"border-collapse: collapse; text-align: justify;\"><span style=\"text-align: justify;\">Dalam pertemuan tersebut, EGM Pertamina Patra Niaga menyampaikan apresiasi atas kesediaan Pangkoarmada III menerima kunjungan kerja ini. Ia menegaskan bahwa pertemuan ini merupakan langkah strategis untuk menjaga hubungan baik dengan berbagai pemangku kepentingan, mulai dari TNI-Polri hingga pemerintah daerah dan masyarakat.</span><br style=\"border-collapse: collapse; text-align: justify;\"><br style=\"border-collapse: collapse; text-align: justify;\"><span style=\"text-align: justify;\">Pangkoarmada III menyambut baik kunjungan tersebut dan menegaskan komitmen TNI AL dalam mendukung kelancaran distribusi energi sesuai dengan kewenangan yang dimiliki. Kedua pihak juga membahas sejumlah isu strategis, termasuk tantangan distribusi energi di wilayah perairan Papua dan Maluku, serta peran Pertamina Patra Niaga dalam mendukung ketahanan energi nasional dan program Asta Cita Pemerintah Pusat.</span><br style=\"border-collapse: collapse; text-align: justify;\"><br style=\"border-collapse: collapse; text-align: justify;\"><span style=\"text-align: justify;\">Turut hadir dalam pertemuan ini, Kas Koarmada III Laksamana Pertama TNI Singgih Sugiarto, S.T., M.Si., Kapok Sahli Koarmada III Laksamana Pertama TNI Heriyanto, serta para asisten Pangkoarmada III. Sementara itu, EGM Pertamina didampingi oleh Region Manager Retail Sales Papua Maluku Ayub Ritto, Region Manager HSSE Papua Maluku, serta sejumlah manajer dari tim sales dan CSR Pertamina Patra Niaga Regional Papua Maluku.</span><br style=\"border-collapse: collapse; text-align: justify;\"><br style=\"border-collapse: collapse; text-align: justify;\"><span style=\"text-align: justify;\">Dengan adanya kerja sama ini, diharapkan distribusi BBM dan LPG di Papua serta Maluku semakin terjamin, memberikan manfaat bagi masyarakat dan sektor industri di kedua wilayah tersebut.</span></p>', '2025-03-24 08:15:50', NULL, 1, '-PANGKOARMADA-III-TERIMA-KUNJUNGAN-KEHORMATAN-EGM-PERTAMINA-PATRA-NIAGA-REGIONAL-PAPUA-MALUKU', 'ea571676ce9b75b0730a5d56350ae93ejpeg', NULL, 'admin', NULL),
(43, 'TINGKATKAN KOMPREHENSIF STRATEGIC PARTNERSHIP DI KAWASAN, TNI AL GELAR NAVY TO NAVY TALKS DENGAN ROYAL THAI NAVY DI JAKARTA', 5, 15, '<p><span style=\"color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\">Dalam rangka memperkuat hubungan bilateral dan meningkatkan kerjasama maritim, TNI AL menggelar 11th Navy to Navy Talks (NTNT) Tahun 2025 dengan Angkatan Laut Kerajaan Thailand (Royal Thai Navy/RTN) bertempat di Wisma Elang Laut (WEL), Menteng, Jakarta Pusat. Selasa (25/3/2025).&nbsp;</span><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><span style=\"color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\">Dalam pertemuan bilateral tersebut, delegasi TNI AL dipimpin oleh Asisten Operasi Kepala Staf Angkatan Laut (Asops Kasal) Laksamana Muda TNI Yayan Sofiyan. Sedangkan Delegasi Royal Thai Navy (RTN) dipimpin oleh Director of Office of Policy and Planning Naval Operations Department (HOD) RADM Chaksawat Saiwong.</span><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><span style=\"color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\">Dalam sambutannya, Asops Kasal mengungkapkan bahwa kerjasama maritim antara TNI AL dan RTN telah berkembang pesat selama lebih dari satu dekade. \"Kerjasama ini telah membawa manfaat yang signifikan bagi kedua negara, terutama dalam hal peningkatan keamanan dan stabilitas di kawasan,\" katanya.</span><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><span style=\"color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\">Pada pertemuan kali ini, kedua Angkatan Laut membahas beberapa poin kerjasama penting, seperti penguatan Confidence Building Measures (CBM) melalui peningkatan interaksi level strategis dan operasional antara TNI AL dan RTN. Kemudian, dibahas juga upaya peningkatan Capacity and Capability Building melalui inisiasi bilateral passing exercise (Passex) pada kegiatan operasi Malacca Strait Sea Patrol (MSPP). Pertemuan ini juga membahas kerjasama pada bidang pendidikan dan pelatihan.</span><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><span style=\"color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\">“Saya yakin bahwa hasil dari pertemuan kita hari ini akan semakin mempererat pemahaman bersama, memberikan manfaat lebih besar, dan dapat diimplementasikan oleh kedua angkatan laut di masa depan,” tutup Asops Kasal.&nbsp;</span><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><span style=\"color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\">Keberlanjutan forum NTNT antara TNI AL dan RTN, merupakan wujud nyata komitmen TNI AL guna memperkuat perannya dalam menjaga stabilitas keamanan maritim di kawasan melalui berbagai kerja sama strategis yang tentunya sesuai dengan penekanan Kepala Staf Angkatan Laut (Kasal) Laksamana TNI Dr. Muhammad Ali yaitu TNI AL akan terus memperkuat diplomasi maritim, bukan hanya dengan mempererat hubungan bilateral, tetapi juga berkontribusi pada keamanan dan stabilitas maritim dikawasan dan global demi terjaganya stabilitas keamanan dan perdamaian.</span><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><span style=\"color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\">Demikian Berita Dinas Penerangan Angkatan Laut.</span></p>', '2025-03-26 04:35:52', '2025-03-26 06:32:39', 1, 'TINGKATKAN-KOMPREHENSIF-STRATEGIC-PARTNERSHIP-DI-KAWASAN,-TNI-AL-GELAR-NAVY-TO-NAVY-TALKS-DENGAN-ROYAL-THAI-NAVY-DI-JAKARTA', '9679ccb5a92f650b83fcf29e0a6a6775jpeg', 1, 'admin', NULL),
(44, 'KASAL HADIRI BAZAR RAMADAN TNI TAHUN 2025', 6, 18, '<p><span style=\"color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\">Kepala Staf Angkatan Laut (Kasal) Laksamana TNI Dr. Muhammad Ali beserta Kepala Staf Angkatan hadir dalam pelaksanaan Bazar Ramadan TNI Tahun 2025 yang dibuka secara langsung oleh Panglima TNI Jenderal TNI Agus Subiyanto bertempat di GOR Ahmad Yani Mabes TNI, Cilangkap, Jakarta Timur, Selasa (25/3/2025).&nbsp;</span><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><span style=\"color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\">Kegiatan Bazar Murah TNI yang berlangsung selama 2 hari mulai tanggal 25 hingga 26 Maret 2025 ini, juga serentak diadakan di seluruh wilayah bertempat di satuan masing-masing dalam rangka menyambut Hari Raya Idul Fitri 1446 H tahun 2025.&nbsp;</span><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><span style=\"color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\">Sebanyak 200 stand yang berasal dari tiga matra TNI ini turut meramaikan acara bazar murah. Sejumlah stand-stand dari Satker TNI AL wilayah jakarta juga turut berpartisipasi menyediakan pakaian, makanan siap saji, aneka kue lebaran, dan aksesori yang dijual dengan harga jauh lebih murah dari harga di pasaran.</span><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><span style=\"color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\">Selain itu, sebagai bentuk kepedulian sosial kepada masyarakat, Panglima TNI bersama para Kepala Staf Angkatan juga membagikan 1.000 paket sembako kepada perwakilan anak yatim piatu.&nbsp;</span><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><span style=\"color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\">Dalam sambutannya, Panglima TNI menyampaikan bahwa kegiatan bazar ini selalu dinanti-nanti dan direspon positif oleh seluruh Prajurit, PNS, dan warga sekitar terbukti dengan tingginya antusias peserta dan pengunjung yang hadir.&nbsp;</span><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><span style=\"color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\">Ia juga berharap kegiatan bazar ini dapat membantu seluruh pengunjung baik prajurit, PNS, dan masyarakat yang hadir dalam memenuhi kebutuhan menjelang Hari Raya Idul Fitri 1446 H.</span><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"></p>', '2025-03-26 04:43:29', '2025-03-26 06:56:56', 1, 'KASAL-HADIRI-BAZAR-RAMADAN-TNI-TAHUN-2025', 'ddf9c9a45551e218c4018d5c53e9f6bbjpeg', 3, 'admin', NULL),
(45, 'JAGA SOLIDITAS, PRAJURIT WING UDARA 1 DAN PRAJURIT LANUDAL TANJUNGPINANG OLAHRAGA BERSAMA', 6, 19, '<p><span style=\"color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\">Guna menjaga soliditas sesama insan Penerbangan TNl AL dan menjaga kesehatan selama bulan suci Ramadhan, prajurit Wing Udara 1 Puspenerbal dan Lanudal Tanjungpinang melaksanakan olahraga bersama yang digelar &nbsp;di Mako Wing Udara 1 Puspenerbal Tanjungpinang, Selasa (25/3/2025).&nbsp;</span><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><span style=\"color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\">Olahraga bersam ini diikuti langsung Komandan Wing Udara 1 Puspenerbal Tanjungpinang, Kolonel Laut (P) Anang Adhi Purwonugroho dan Komandan Lanudal Tanjungpinang, Kolonel Laut (P) Sahid Hamdani.</span><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><span style=\"color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\">Kegiatan ini dilaksanakan dengan rute yang telah ditentukan di sekitar lingkungan Mako Wing Udara 1. Jalan sehat ini bertujuan untuk menjaga kebugaran tubuh serta meningkatkan kebersamaan dan semangat juang prajurit, meskipun sedang menjalankan ibadah puasa.</span><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><span style=\"color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\">Dalam arahannya, Danwing Udara 1 Puspenerbal menyampaikan pentingnya menjaga kesehatan dan kebugaran fisik agar tetap prima dalam menjalankan tugas, terutama di bulan Ramadhan ini.</span><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><span style=\"color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\">“Olahraga ringan seperti jalan sehat ini sangat bermanfaat untuk menjaga kebugaran tubuh, terutama saat berpuasa. Dengan fisik yang sehat, kita dapat menjalankan tugas dengan baik dan tetap semangat,” ujar Komandan Wing Udara 1.</span><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><br style=\"border-collapse: collapse; color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\"><span style=\"color: rgb(33, 37, 41); font-family: OswaldRegular, Tahoma, sans-serif; font-size: 17.6px; text-align: justify;\">Dengan adanya kegiatan ini, diharapkan prajurit Wing Udara 1 tetap dalam kondisi prima dan semakin solid dalam menjalankan tugas menjaga kedaulatan udara maritim Indonesia.</span></p>', '2025-03-26 04:44:26', '2025-03-26 06:31:14', 1, 'JAGA-SOLIDITAS,-PRAJURIT-WING-UDARA-1-DAN-PRAJURIT-LANUDAL-TANJUNGPINANG-OLAHRAGA-BERSAMA', 'c57de7ffb63a04971dc3a933cf2f080djpeg', 2, 'admin', NULL),
